        } else if (i == 5) {
            return modulus5;
        } else if (i == 6) {
            return modulus6;
        } else if (i == 7) {
            return modulus7;
        } else if (i == 8) {
            return modulus8;
        } else if (i == 9) {
            return modulus9;
        }
    }

    function getSignature(uint i) view internal returns (bytes) {
        if (i == 0) {
            return signature0;
        } else if (i == 1) {
            return signature1;
        } else if (i == 2) {
            return signature2;
        } else if (i == 3) {
            return signature3;
        } else if (i == 4) {
